import React from "react";
import { NavLink } from "react-router-dom";
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import "./AuthNavbar.css"
import { UserContext } from "../../utils/UserContext";
import { USER_LOGOUT } from "../../utils/actions";


function AuthNavBar(props) {
  const { state, dispatch } = React.useContext(UserContext);
  return(

      <Navbar expand="lg" id="NavBar">
      <div id="logo">

      </div>
      <Navbar.Brand id="NavBrand" href="/">scout</Navbar.Brand>

      <Navbar.Toggle aria-controls="basic-navbar-nav" />

      <Navbar.Collapse id="basic-navbar-nav"> 
        <Nav className="navbar-nav ml-auto pr-5">
          <div className="navbar-nav">
          {state.user_type === "user" ? (
            <NavLink to="/dashboard" id="dashboard">
                Pet Dashboard
              </NavLink>
            ) : (
              <NavLink to="/admin" id="Admin">
                Pet Dashboard
              </NavLink>
            )}
          </div>

            <NavLink
              className="navbar-nav"
              to={`/users/${state._id}`}
              id="Profile"
            >
              Pet Dashboard
            </NavLink>

              <div
              className="navbar-nav"
              id="Logout"

              onClick={() => {
                dispatch({ type: USER_LOGOUT })
                props.history.push("/");
              }}
              >
                Logout

              </div>
 </Nav>



        </Navbar.Collapse>
      </Navbar>

  );
}

export default AuthNavBar;
